import React from "react";
import styled from "styled-components";
import { BrandLogo } from "../brandLogo";
import { Button } from "../button";
import { Marginer } from "../marginer";
import { Link } from "react-router-dom";

const NavbarContainer = styled.div`
    width:100%;
    height:85px;
    display:flex;
    align-items:center;
    justify-content:space-between;
    background-color: ${({ useTransparent}) => useTransparent ? "transparent " : "#264653"};
`;

const AccessibilityContainer = styled.div`
    display:flex;
    height:100%;
    align-items:center;
    margin:0.4em 1em 0 0;
`;

const AnchorLink = styled.a`
    font-size: 17px;
    color:#fff;
    cursor:pointer;
    text-decoration:none;
    outline:none;
    transition: all 200ms ease-in-out;
    margin: 0em 0 0 0;

    &:hover{
        filter: contrast(0.6);
    }
`;

const Pipe = styled.div`
    min-height:80%;
    width: 1px;
    background-color:#fff;

`;

export function Navbar(props){
    const {useTransparent} = props;
    return (
        <NavbarContainer useTransparent={useTransparent}>
            <BrandLogo/>
            <AccessibilityContainer>
                <AnchorLink>Pet Specialist Portal</AnchorLink>
                <Marginer direction="horizontal" margin="20px"/>
                <Pipe/>
                <Link to="/customer/access">
                    <Button size={15}>Register</Button>
                    </Link>

                <Marginer direction="horizontal" margin="24px"/>
                <AnchorLink>Login</AnchorLink>

            </AccessibilityContainer>
        </NavbarContainer>
    );
}
